import React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import MenuItem from "@mui/material/MenuItem";

const category = [
  { value: 0, label: "Dynamic" },
  { value: 1, label: "Tree" },
];

const level = [
  { value: 0, label: "Easy" },
  { value: 0, label: "Medium" },
  { value: 0, label: "Hard" },
];
function ModalAddQuestion() {
  return (
    <Box
      component="form"
      sx={{
        "& .MuiTextField-root": { m: 1, width: "25ch" },
        "& .MuiInputBase-root": {
          color: "white",
        },
        "& .MuiInputLabel-root": {
          color: "white",
        },
        "& .MuiOutlinedInput-root": {
          "& fieldset": {
            borderColor: "white",
          },
          "&:hover fieldset": {
            borderColor: "white",
          },
          "&.Mui-focused fieldset": {
            borderColor: "white",
          },
        },

        backgroundColor: "#1e1e1e",
        borderRadius: "20px",
      }}
      noValidate
      autoComplete="off"
    >
      <div className="flex flex-col">
        {/* Column 1 */}
        <div className="flex flex-row justify-center">
          <TextField
            id="outlined-number"
            label="Number"
            type="number"
            InputLabelProps={{
              shrink: true,
            }}
            sx={{ width: "20cx"}} // Custom width and height
          />
          <TextField
            id="outlined-basic"
            label="Sub-Heading"
            variant="outlined"
          />

          <TextField id="outlined-select-currency" select label="Category">
            {category.map((option) => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>
        </div>

        {/* Column 2 */}
        <div>

        </div>
        <TextField id="outlined-select-currency" select label="Category">
            {category.map((option) => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>
        <TextField
          id="outlined-multiline-flexible"
          label="Multiline"
          multiline
          maxRows={4}
        />
        <TextField
          id="outlined-textarea"
          label="Multiline Placeholder"
          placeholder="Placeholder"
          multiline
        />
        <TextField
          id="outlined-multiline-static"
          label="Multiline"
          multiline
          rows={4}
          defaultValue="Default Value"
        />
      </div>
    </Box>
  );
}

export default ModalAddQuestion;
